images.amount[1].src = '50.png';
images.amount[2].src = '100.png';
images.amount[3].src = 'all.png';


document.getElementById('swag').onclick = function() {
  const stuff = acidreflux();
  
  const modei  = images.mode [ stuff.mode  ]; modei.width  = modei.height  = 64;
  const counti = images.count[ stuff.count ]; counti.width = counti.height = 64;
  const speedi = images.speed[ stuff.speed ]; speedi.width = speedi.height = 64;
  const sizei  = images.size [ stuff.size  ]; sizei.width  = sizei.height  = 64;
  
  

  let o = document.getElementById('output');
  o.innerHTML = '';

  o.appendChild(modei);
  o.appendChild(counti);
  o.appendChild(speedi);
  o.appendChild(sizei);

  if(stuff.amount !== null) {
    const amounti = images.amount[stuff.amount];
    amounti.width = amounti.height = 64;
    o.appendChild(amounti);

    let wr = records[
      map.count[stuff.count]
    ][
      map.speed[stuff.speed]
    ][
      map.size[stuff.size]
    ][
      map.mode[stuff.mode]
    ][
      map.amount[stuff.amount]
    ];
    if(wr.length === 0)
      wr = { primary_t: -1 };
    else if(Object.keys(wr[0]).indexOf('times') !== -1)
      wr = wr[0].times;
    else
      wr = { primary_t: -1 };
    wr = wr.primary_t || wr.realtime_t;
    // console.log(wr);

    document.getElementById('attempts').innerHTML = (
      wr < 0 ? 'no wr, idk' :
      wr < 60 ? '4 minutes' :
      wr < 90 ? '5 minutes' :
      wr < 150 ? '7 minutes' :
      '10 minutes'
    );
  } else {
    let attempts = 1;
    if(stuff.size === 1)
      attempts = 2;
    if(stuff.speed === 1)
      attempts++;
    document.getElementById('attempts').innerHTML = `${attempts} attempt${attempts > 1 ? 's' : ''}`;
  }

  
  
};

document.getElementById('copy').onclick = function() {
  const a = document.getElementById('output').children;
  if(a.length === 0)return;

  const mode = map.mode[~~a[0].src.match(/trophy_\d\d/)[0].match(/\d\d/)[0]].toLowerCase().replace(/ /g, '');
  const count = a[1].src.match(/count_\d\d/)[0];
  const speed = a[2].src.match(/speed_\d\d/)[0];
  const size = a[3].src.match(/size_\d\d/)[0];
  let amount = '';
  if(a.length === 5) amount = a[4].src.match(/[a-zA-Z0-9]{2,3}\.png/)[0].replace('.png', '');
  const attempts = document.getElementById('attempts').innerHTML;
  

  navigator.clipboard.writeText(`:${mode === 'key' ? 'key~1' : mode === 'minesweeper' ? 'minesweeper_flag' : mode}: :${count}: :${speed}: :${size}: ${amount}${attempts.includes('attempt') ? '' : '\n' + attempts}`);

};


function acidreflux() {
  let mode   = ~~(Math.random() * 14);
  let count  = ~~(Math.random() * 3);
  let speed  = ~~(Math.random() * 2);
  let size   = ~~(Math.random() * 2);
  let amount = null;


  if(count === 0 && size === 0)
    return acidreflux();

  if(!(mode === 1 || mode === 2 || mode === 8 || mode === 9 || mode === 10 || mode === 12)) {
    if(size === 0) {
      amount = ~~(Math.random() * 4);
    } else if((mode === 7 || mode === 3) && size === 1) {
      amount = ~~(Math.random() * 2);
      if(amount === 1)
        amount = 3;
    } else {
      amount = ~~(Math.random() * 3);
      if(amount === 2)
        amount = 3;
    }
  }

  return {
    mode:   mode,
    count:  count,
    speed:  speed,
    size:   size,
    amount: amount,
  };

}
